import React, { Component } from 'react';
import './App.css';
import AppBar from './components/AppBar';

class App extends Component {
	render() {
		return (
			<div className="App">
				<header className="App-header">
					<AppBar />
				</header>
			</div>
		);
	}
}

export default App;


